import React from "react";
import 'bulma/css/bulma.min.css';
import face from '../images/FaceIMG.png';

const About = () => {
    return(
        <div className={'container p-4'}>
            <div className={'card m-4'}>
                <div className={'col'}>
                    <h1>NAME</h1>
                </div>
                <div className={'col'}>
                    <img src={face} alt={'Jack'} className={'profile'}/>
                </div>
            </div>
        </div>
    );
}

export default About;
